arStrings.szText:
{c_highlight}켬:{/c} 다른 플랫폼의 플레이어를 만나 함께 게임을 할 수 있습니다.
{c_highlight}끔:{/c} 다른 플랫폼의 플레이어와 만나거나 함께 게임을 할 수 없습니다.

{c_highlight}이 설정은 캐릭터 선택 화면에서만 변경할 수 있습니다.{/c}

활성화된 음성 채널에서 음성 채팅을 텍스트로 받아쓰는 기능을 켭니다.

자세한 정보는 {c_highlight}https://blizzard.com/legal/{/c} 웹사이트의 온라인 개인정보 처리방침에서 확인할 수 있습니다.

{c_highlight}영문 음성만 지원합니다.{/c}
